import React from "react";
import './content1.css';

const Content1=()=>{
  return(
    <section className="Homeblock">
      <div className="flexSectionBody">
        <div className="topSectionHeading">
        <h2>
          <i>
            Beyond words, <br/> our impact in numbers.
          </i>
        </h2>   
        </div>

        <div className="midSectionInfo">
          <p><span className="homeNavyB"></span>Data</p>
        </div>

      </div>
    </section>
  )
}
export default Content1;
